import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './compoments/Navbar';
import Error from './compoments/Error';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <Routes>
        <Route path="/"/>
        <Route path="*" element={<Error />} />
      </Routes>
    </div>
  );
}

export default App;
